import React from "react";
import { Form } from "antd";

const FormItem = Form.Item;
function componentSuggestion() {
  return (
    <FormItem>
      <div style={{ width: "398px", height: "222px", background: "white",borderRadius:"25px",padding:"10px" }}>
          <h1 style={{color:"red"}}>Bas</h1>
      </div>
    </FormItem>
  );
}

export default componentSuggestion;
